import React, {Component} from 'react';
import './Node.css'

class Node extends Component {
    constructor(props){
        super(props);
        this.tate={};
    }

    render(){
        const {isFinish, isStart} = this.props;
        const exClassName = isFinish
         ? 'node-finish'
         : isStart
         ? ''
         : 'node-start';

        return <div className={`node ${exClassName}`}/>
    }
}

export const DEFAULT_NODE = {
    row: 0,
    col: 0,
}

export default Node;
